eval("module.exports = {\"version\":\"2021-02-08\",\"questions\":[{\"id\":\"K1\",\"prompt\":\"What is your citizenship?\",\"options\":[{\"id\":\"EU\",\"label\":\"EU/EEA citizen\",\"next\":\"EU-K2\"},{\"id\":\"Nordic\",\"label\":\"Nordic citizen\",\"next\":\"Nordic-K2\"},{\"id\":\"NonEU\",\"label\":\"Non-EU citizen\",\"next\":\"NonEU-K2\"}]},{\"id\":\"EU-K2\",\"prompt\":\"How long are you going to stay in Finland?\",\"options\":[{\"id\":\"EU-K2-A\",\"label\":\"Less than 90 days\",\"next\":null,\"checklist\":[\"EU-K2-A\"]},{\"id\":\"EU-K2-B\",\"label\":\"More than 90 days\",\"next\":\"EU-K3\",\"checklist\":[\"EU-K2-B\"]}]},{\"id\":\"EU-K3\",\"prompt\":\"What is the purpose of your stay in Finland?\",\"options\":[{\"id\":\"EU-K3-A\",\"label\":\"I will work\",\"next\":\"EU-K5\",\"checklist\":[\"EU-K3-A\"]},{\"id\":\"EU-K3-B\",\"label\":\"I will look for work\",\"next\":null,\"checklist\":[\"EU-K3-B\"]},{\"id\":\"EU-K3-C\",\"label\":\"I will study\",\"next\":\"EU-K4\",\"checklist\":[\"EU-K3-C\"]}]},{\"id\":\"EU-K4\",\"prompt\":\"Are you planning to work while studying?\",\"options\":[{\"id\":\"EU-K4-A\",\"label\":\"Yes, I am\",\"next\":\"EU-K5\",\"checklist\":[\"EU-K4-A\"]},{\"id\":\"EU-K4-B\",\"label\":\"No, I am not\",\"next\":\"EU-K5\",\"checklist\":[]}]},{\"id\":\"EU-K5\",\"prompt\":\"Are you moving alone or with your family?\",\"options\":[{\"id\":\"EU-K5-A\",\"label\":\"Alone\",\"next\":\"EU-K6\",\"checklist\":[]},{\"id\":\"EU-K5-B\",\"label\":\"With Family\",\"next\":\"EU-K6\",\"checklist\":[\"EU-K5-B\"]}]},{\"id\":\"EU-K6\",\"prompt\":\"How old are you?\",\"options\":[{\"id\":\"EU-K6-A\",\"label\":\"Under 18-years old\",\"next\":null,\"checklist\":[\"EU-K6-A\"]},{\"id\":\"EU-K6-B\",\"label\":\"Over 18-years old\",\"next\":null,\"checklist\":[]}]},{\"id\":\"NonEU-K2\",\"prompt\":\"How long are you going to stay in Finland?\",\"options\":[{\"id\":\"NonEU-K2-A\",\"label\":\"Less than 90 days\",\"next\":null,\"checklist\":[\"NonEU-K2-A\"]},{\"id\":\"NonEU-K2-B\",\"label\":\"More than 90 days\",\"next\":\"NonEU-K3\",\"checklist\":[\"NonEU-K2-B\"]}]},{\"id\":\"NonEU-K3\",\"prompt\":\"What is the purpose of your stay in Finland?\",\"options\":[{\"id\":\"NonEU-K3-A\",\"label\":\"I will work\",\"next\":\"NonEU-K5\",\"checklist\":[\"NonEU-K3-A\"]},{\"id\":\"NonEU-K3-C\",\"label\":\"I will study\",\"next\":\"NonEU-K4\",\"checklist\":[\"NonEU-K3-C\"]}]},{\"id\":\"NonEU-K4\",\"prompt\":\"Are you planning to work while studying?\",\"options\":[{\"id\":\"NonEU-K4-A\",\"label\":\"Yes, I am\",\"next\":\"NonEU-K6\",\"checklist\":[\"NonEU-K4-A\"]},{\"id\":\"NonEU-K4-B\",\"label\":\"No, I am not\",\"next\":\"NonEU-K6\",\"checklist\":[]}]},{\"id\":\"NonEU-K5\",\"prompt\":\"Are you moving alone or with your family?\",\"options\":[{\"id\":\"NonEU-K5-A\",\"label\":\"Alone\",\"next\":\"NonEU-K7\",\"checklist\":[]},{\"id\":\"NonEU-K5-B\",\"label\":\"With family\",\"next\":\"NonEU-K7\",\"checklist\":[\"NonEU-K5-B\"]}]},{\"id\":\"NonEU-K6\",\"prompt\":\"How old are you?\",\"options\":[{\"id\":\"NonEU-K6-A\",\"label\":\"Under 18-years old\",\"next\":\"NonEU-K5\",\"checklist\":[\"NonEU-K6-A\"]},{\"id\":\"NonEU-K6-B\",\"label\":\"Over 18-years old\",\"next\":\"NonEU-K5\",\"checklist\":[]}]},{\"id\":\"NonEU-K7\",\"prompt\":\"Are you already in Finland?\",\"options\":[{\"id\":\"NonEU-K7-A\",\"label\":\"Yes, I am\",\"next\":null,\"checklist\":[\"NonEU-K7-A\"]},{\"id\":\"NonEU-K7-B\",\"label\":\"No, I am not\",\"next\":null,\"checklist\":[\"NonEU-K7-B\"]}]},{\"id\":\"Nordic-K2\",\"prompt\":\"How long are you going to stay in Finland?\",\"options\":[{\"id\":\"Nordic-K2-A\",\"label\":\"Less than 90 days\",\"next\":null,\"checklist\":[\"Nordic-K2-AB\"]},{\"id\":\"Nordic-K2-B\",\"label\":\"More than 90 days\",\"next\":\"Nordic-K3\",\"checklist\":[\"Nordic-K2-AB\"]}]},{\"id\":\"Nordic-K3\",\"prompt\":\"What is the purpose of your stay in Finland?\",\"options\":[{\"id\":\"Nordic-K3-A\",\"label\":\"I will work\",\"next\":null,\"checklist\":[\"Nordic-K3-A\"]},{\"id\":\"Nordic-K3-B\",\"label\":\"I will look for work\",\"next\":null,\"checklist\":[\"Nordic-K3-B\"]},{\"id\":\"Nordic-K3-C\",\"label\":\"I will study\",\"next\":\"Nordic-K4\",\"checklist\":[\"Nordic-K3-C\"]}]},{\"id\":\"Nordic-K4\",\"prompt\":\"Are you planning to work while studying?\",\"options\":[{\"id\":\"Nordic-K4-A\",\"label\":\"Yes, I am\",\"next\":\"Nordic-K6\",\"checklist\":[\"Nordic-K4-A\"]},{\"id\":\"Nordic-K4-B\",\"label\":\"No, I am not\",\"next\":\"Nordic-K6\",\"checklist\":[]}]},{\"id\":\"Nordic-K6\",\"prompt\":\"How old are you?\",\"options\":[{\"id\":\"Nordic-K6-A\",\"label\":\"Under 18-years old\",\"next\":null,\"checklist\":[\"Nordic-K6-A\"]},{\"id\":\"Nordic-K6-B\",\"label\":\"Over 18-years old\",\"next\":null,\"checklist\":[]}]}],\"checklist\":[{\"id\":\"EU-K2-A\",\"topic\":null,\"heading\":\"Less than 90 days\",\"content\":{\"html\":\"<p>\\n  EU citizens have the same rights as Finnish citizens to work, study and\\n  start a business in Finland. Therefore, they do not need a residence\\n  permit.\\n</p>\\n<p>\\n  As an EU citizen, you can stay and work freely in Finland for up to\\n  three months with only a valid identity card or passport. If you end up\\n  staying in Finland for more than three months, however, you must\\n  register your right of residence with the Finnish Immigration Service\\n  (<a target=\\\"_blank\\\"\\n  href=\\\"https://migri.fi/en/registration-of-right-of-residence\\\">Migri.fi</a>).\\n</p>\\n<p>\\n  You will need a tax card from the Tax Administration (<a target=\\\"_blank\\\"\\n  href=\\\"https://www.vero.fi/en/individuals/tax-cards-and-tax-returns/tax_card/\\\">Vero.fi</a>),\\n  if you plan on working.\\n</p>\"}},{\"id\":\"EU-K2-B\",\"topic\":null,\"heading\":\"More than 90 days\",\"content\":{\"html\":\"<p>\\n  EU citizens have the same rights as Finnish citizens to work, study and\\n  start a business in Finland. Therefore, they do not need a residence\\n  permit. If you plan to stay in Finland for more than three months,\\n  however, you must register your right of residence with the Finnish\\n  Immigration Service (<a target=\\\"_blank\\\"\\n  href=\\\"https://migri.fi/en/registration-of-right-of-residence\\\">Migri.fi</a>).\\n\\n</p>\\n<p>\\n  The application must be submitted within three months of the day of your\\n  arrival, at the latest. To complete the registration, you must book an\\n  appointment and visit a service point of the Finnish Immigration\\n  Service. The immigration authorities will ask you at this time to prove\\n  that you can earn your own livelihood and meet the requirements for\\n  registration. See <a target=\\\"_blank\\\"\\n  href=\\\"https://migri.fi/en/registration-of-right-of-residence\\\">Migri.fi</a>\\n  for more information.\\n</p>\\n<p>\\n  After this, you need to register your municipality of residence with the\\n  population register (<a target=\\\"_blank\\\"\\n  href=\\\"https://dvv.fi/en/foreigner-registration\\\">Dvv.fi</a>). Once you\\n  have registered in person with these two authorities, you will receive a\\n  personal identity code. This means you will be considered a Helsinki\\n  resident and be entitled to municipal services.\\n</p>\"}},{\"id\":\"EU-K3-A\",\"topic\":null,\"heading\":\"I will work\",\"content\":{\"html\":\"<p>\\n  You will need a tax card from the Tax Administration (<a target=\\\"_blank\\\"\\n  href=\\\"https://www.vero.fi/en/individuals/tax-cards-and-tax-returns/tax_card/\\\">Vero.fi</a>),\\n  if you plan on working.\\n</p>\\n<p>\\n  In order to get a tax card, you will need an identity code. If you have\\n  not received a personal identity code yet, you can apply for one at the\\n  tax office. You will be asked to show your employment contract, proof of\\n  completed EU registration (if you have been in Finland more than three\\n  months), and a valid passport or photo ID in order to receive this code.\\n</p>\"}},{\"id\":\"EU-K3-B\",\"topic\":null,\"heading\":\"I will look for work\",\"content\":{\"html\":\"<p>\\n  EU citizens may stay in Finland for up to 90 days as jobseekers without\\n  needing to register with employment services. After this, they must\\n  register as a jobseeker at their local TE office (<a target=\\\"_blank\\\"\\n  href=\\\"http://www.te-palvelut.fi/te/en/index.html\\\">Te-palvelut.fi</a>).\\n</p>\\n<p>\\n  You will need a tax card from the Tax Administration (<a target=\\\"_blank\\\"\\n  href=\\\"https://www.vero.fi/en/individuals/tax-cards-and-tax-returns/tax_card/\\\">Vero.fi</a>),\\n  if you plan on working in Finland. In order to get a tax card, you will\\n  need an identity code. If you have not received a personal identity code\\n  yet, you can apply for one at the tax office. You will be asked to show\\n  your employment contract, proof of completed EU registration (if you\\n  have been in Finland more than three months), and a valid passport or\\n  photo ID to receive this code.\\n</p>\"}},{\"id\":\"EU-K3-C\",\"topic\":null,\"heading\":\"I will study\",\"content\":{\"html\":\"<p>\\n  If you have come to Helsinki to study as an EU citizen, you must show a\\n  certificate of attendance from a Finnish learning institution when\\n  registering your right of residence with the Finnish Immigration Service\\n  (<a target=\\\"_blank\\\" href=\\\"https://migri.fi/en/registration-of-right-of-residence\\\">Migri.fi</a>).\\n</p>\\n<p>\\n  Please note that if your only reason for moving to Finland is to study,\\n  you will likely not be eligible for state-supported social benefits, as\\n  you will be considered a temporary resident. See the state benefits\\n  agency <a target=\\\"_blank\\\"\\n  href=\\\"https://www.kela.fi/web/en/from-other-countries-to-finland-students-and-researchers\\\">Kela.fi</a>\\n  for more information.\\n</p>\"}},{\"id\":\"EU-K4-A\",\"topic\":null,\"heading\":\"I'm planning to work while studying\",\"content\":{\"html\":\"<p>\\n  If you are planning to work or start a business while you study, you\\n  will need to apply for a tax card from the Tax Administration (<a target=\\\"_blank\\\"\\n  href=\\\"https://www.vero.fi/en/individuals/tax-cards-and-tax-returns/tax_card/\\\">Vero.fi</a>).\\n  If you work in construction, you will also need a tax number. In order\\n  to get a tax card, you will need an identity code.\\n</p>\\n<p>\\n  If you have not received a personal identity code yet, you can apply for\\n  one at the tax office. You will be asked to show your employment\\n  contract, proof of completed EU registration (if you have been in\\n  Finland more than three months), and a valid passport or photo ID to\\n  receive this code.\\n</p>\"}},{\"id\":\"EU-K5-B\",\"topic\":null,\"heading\":\"With Family\",\"content\":{\"html\":\"<p>\\n  Family members of citizens of EU countries have the right to move to\\n  Finland to be with their family. If your family members are also\\n  citizens of EU countries, they must register their right of residence\\n  with the Finnish Immigration Service (<a target=\\\"_blank\\\" href=\\\"https://migri.fi/en/registration-of-right-of-residence\\\">Migri.fi</a>). The registration\\n  application must be submitted within three months of the day of arrival\\n  at the latest.\\n</p>\\n<p>\\n  If your family members are citizens of non-EU countries and they meet\\n  the requirements set by the Finnish Immigration Service, they can apply\\n  for a Residence card for a family member of an EU citizen. See <a target=\\\"_blank\\\"\\n  href=\\\"https://www.vero.fi/en/individuals/tax-cards-and-tax-returns/tax_card/\\\">Migri.fi</a>\\n  for more information.\\n</p>\\n<p>\\n  Family members who are granted a right of residence by the immigration\\n  authorities must then register their municipality of residence with the\\n  population register (<a target=\\\"_blank\\\"\\n  href=\\\"https://dvv.fi/en/foreigner-registration\\\">Dvv.fi</a>). After this,\\n  they will receive a personal identity code. This means they will be\\n  considered Helsinki residents and be entitled to municipal services.\\n</p>\"}},{\"id\":\"EU-K6-A\",\"topic\":null,\"heading\":\"Under 18-years old\",\"content\":{\"html\":\"<p>\\n  If you are under 18 years old, you must have written consent from your\\n  guardian(s) to move to Finland. A notary public or other comparable\\n  authority must confirm this written consent document.\\n</p>\\n<p>\\n  You must submit this proof of consent to the Finnish Immigration Service\\n  (<a target=\\\"_blank\\\" href=\\\"https://migri.fi/en/home\\\">Migri.fi</a>) when you register your\\n  right of residence. The registration application must be submitted\\n  within three months of the day of arrival at the latest.\\n</p>\"}},{\"id\":\"NonEU-K2-A\",\"topic\":null,\"heading\":\"Less than 90 days\",\"content\":{\"html\":\"<p>\\n  Citizens of non-EU countries who visit Finland for fewer than 90 days\\n  (as a tourist, visiting family, or on business) need a visa, unless they\\n  are citizens of a visa-exempt country. Check the foreign ministry\\n  website (<a target=\\\"_blank\\\" href=\\\"https://um.fi/visa-to-visit-finland\\\">Um.fi</a>) for\\n  more information on different visa requirements.\\n</p>\\n<p>\\n  If you plan to work in Finland, you may need a residence permit even if\\n  your stay will be shorter than 90 days. Citizens of non-EU countries who\\n  plan to stay for more than 90 days must apply for a residence permit.\\n  See the Finnish Immigration Service (<a target=\\\"_blank\\\"\\n  href=\\\"https://migri.fi/en/home\\\">Migri.fi</a>) for more information.\\n</p>\"}},{\"id\":\"NonEU-K2-B\",\"topic\":null,\"heading\":\"More than 90 days\",\"content\":{\"html\":\"<p>\\n  Citizens of non-EU countries who plan to come to Finland for more than\\n  90 days must first apply for a residence permit from the Finnish\\n  Immigration Service (<a target=\\\"_blank\\\" href=\\\"https://migri.fi/en/home\\\">Migri.fi</a>).\\n  It is not possible to apply for a residence permit on another persons\\n  behalf.\\n</p>\\n<p>\\n  The type of residence permit you need to apply for depends on your\\n  reason for coming to Finland. Residence permit applications are\\n  different if you plan to 1) work in Finland, 2) be with a family member\\n  in Finland, 3) study in Finland, 4) return migrate to Finland, or 5)\\n  come to Finland on other grounds.\\n</p>\\n<p>\\n  You can apply for a residence permit online at <a target=\\\"_blank\\\"\\n  href=\\\"http://www.EnterFinland.fi\\\">EnterFinland.fi</a>, but within three\\n  months of submitting the application, you will need to visit a Finnish\\n  mission (embassy or consulate) in person to confirm your identity and\\n  present original copies of your application appendices. Check if your\\n  documents must be translated or legalised before your scheduled visit.\\n</p>\\n<p>\\n  Applicants must wait for their residence permit decisions in the same\\n  country they submitted the application.\\n</p>\\n<p>\\n  Once the Finnish Immigration Service has granted you a residence permit\\n  and you have moved to Finland, you must register your municipality of\\n  residence with the population register (Dvv.fi). You will then be\\n  assigned a Finnish personal identity code. This means you will be\\n  considered a Helsinki resident and be entitled to municipal services.\\n</p>\"}},{\"id\":\"NonEU-K3-A\",\"topic\":null,\"heading\":\"I will work\",\"content\":{\"html\":\"<p>\\n  Citizens of non-EU countries who plan to come to Finland to work must\\n  first secure a job here and apply for a residence permit for employed\\n  persons before they enter the country. The employer in question must\\n  also complete a form and append it to the residence permit application.\\n</p>\\n<p>\\n  If you already have a residence permit for Finland based on some other\\n  grounds, such as family ties, you may already have the right to work. A\\n  few special permits are granted for specialists, researchers and\\n  seasonal work. Consult the Finnish Immigration Service (<a target=\\\"_blank\\\"\\n  href=\\\"https://migri.fi/en/residence-permit-applications\\\">Migri.fi</a>)\\n  for more information.\\n</p>\\n<p>\\n  If your stay in Finland will exceed three months, you must register your\\n  municipality of residence at the population register (<a target=\\\"_blank\\\"\\n  href=\\\"https://dvv.fi/en/foreigner-registration\\\">Dvv.fi</a>) after your\\n  arrival. Once you have registered in person with these two authorities,\\n  you will receive a personal identity code. This means you will be\\n  considered a Helsinki resident and be entitled to municipal services.\\n</p>\\n<p>\\n  You will need a tax card from the Tax Administration (<a target=\\\"_blank\\\"\\n  href=\\\"https://www.vero.fi/en/individuals/tax-cards-and-tax-returns/tax_card/\\\">Vero.fi</a>),\\n  if you plan on working. If you work in construction, you also need a tax\\n  number. In order to get a tax card, you will need an identity code.\\n</p>\\n<p>\\n  If you have not received a personal identity code yet, you can apply for\\n  one at the tax office. You will be asked to show your employment\\n  contract, residence permit, and a valid passport or photo ID to receive\\n  this code.\\n</p>\"}},{\"id\":\"NonEU-K3-C\",\"topic\":null,\"heading\":\"I will study\",\"content\":{\"html\":\"<p>\\n  Citizens of non-EU countries who plan on coming to Finland to study must\\n  already have been granted a study place before they can apply for a\\n  residence permit based on studies.\\n</p>\\n<p>\\n  Please note that if your only reason for moving to Finland is to study,\\n  you will likely not be eligible for state-supported social benefits, as\\n  you will be considered a temporary resident. See thestate benefit\\n  agency <a target=\\\"_blank\\\"\\n  href=\\\"http://www.kela.fi/web/en/financial-aid-for-students-eligibility\\\">Kela.fi</a>\\n  for more information.\\n</p>\\n<p>\\n  You must register your municipality of residence at the population\\n  register (<a target=\\\"_blank\\\" href=\\\"https://dvv.fi/en/foreigner-registration\\\">Dvv.fi</a>)\\n  upon your arrival.\\n</p>\"}},{\"id\":\"NonEU-K4-A\",\"topic\":null,\"heading\":\"I'm planning to work while studying\",\"content\":{\"html\":\"<p>\\n  If you have been granted a residence permit in Finland based on studies,\\n  the number of hours you can work per week will be limited. See the\\n  Finnish Immigration Service (<a target=\\\"_blank\\\"\\n  href=\\\"https://migri.fi/en/working-and-internships-during-studies\\\">Migri.fi</a>)\\n  for more information.\\n</p>\\n<p>\\n  You will need a tax card from the Tax Administration (<a target=\\\"_blank\\\"\\n  href=\\\"https://www.vero.fi/en/individuals/tax-cards-and-tax-returns/tax_card/\\\">Vero.fi</a>),\\n  if you plan on working.\\n</p>\"}},{\"id\":\"NonEU-K5-B\",\"topic\":null,\"heading\":\"With family\",\"content\":{\"html\":\"<p>\\n  If a non-EU citizen family member wishes to move to Finland to join you,\\n  they must apply for a residence permit from the Finnish Immigration\\n  Service (<a target=\\\"_blank\\\" href=\\\"https://migri.fi/en/home\\\">Migri.fi</a>). Applicants\\n  must wait for their residence permit decisions in the same country they\\n  submitted the application.\\n</p>\\n<p>\\n  In most cases, you must also have proof of sufficient funds to support\\n  both yourself and your family members in Finland. The required income\\n  varies by family size.\\n</p>\\n<p>\\n  Please note that as a rule, Finnish law defines family as the nuclear\\n  family, so unless you can prove that for example your parents or\\n  siblings are solely dependent on your care, they will likely not be\\n  granted a residence permit based on this kind of family tie. See the\\n  website of the Finnish Immigration Service (<a target=\\\"_blank\\\"\\n  href=\\\"https://migri.fi/en/moving-to-finland-to-be-with-a-family-member\\\">Migri.fi</a>)\\n  for more information.\\n</p>\\n<p>\\n  After your family members have their residence permits, they must then\\n  register their municipality of residence at the population register (<a target=\\\"_blank\\\"\\n  href=\\\"https://dvv.fi/en/foreigner-registration\\\">Dvv.fi</a>). Once they\\n  have registered with these two authorities, they will receive personal\\n  identity codes. This means they will be considered Helsinki residents\\n  and be entitled to municipal services. They will also be eligible to\\n  work and study in the same way as other residents of the city.\\n</p>\"}},{\"id\":\"NonEU-K7-A\",\"topic\":null,\"heading\":\"I'm already in Finland\",\"content\":{\"html\":\"<p>\\n  If you are already in Finland, within three months of submitting your\\n  application for a residence permit, you must visit the Finnish\\n  Immigration Service (<a target=\\\"_blank\\\" href=\\\"https://migri.fi/en/home\\\">Migri.fi</a>) in\\n  person to confirm your identity and present original copies of your\\n  application appendices. Check if your documents must be translated or\\n  otherwise legalised before your scheduled visit.\\n</p>\"}},{\"id\":\"NonEU-K7-B\",\"topic\":null,\"heading\":\"I'm not yet in Finland\",\"content\":{\"html\":\"<p>\\n  You can apply for a residence permit online at <a target=\\\"_blank\\\"\\n  href=\\\"http://www.EnterFinland.fi\\\">EnterFinland.fi</a>, but within three\\n  months of submitting the application, you will need to visit a Finnish\\n  mission (embassy or consulate) in person to confirm your identity and\\n  present original copies of your application appendices. Check if your\\n  documents must be translated or legalised before your scheduled visit.\\n</p>\"}},{\"id\":\"NonEU-K6-A\",\"topic\":null,\"heading\":\"Under 18-years old\",\"content\":{\"html\":\"<p>\\n  If you are under the age of 18, you must have written consent from your\\n  guardian(s) to move to Finland. A notary or other comparable authority\\n  must confirm the document of consent.\\n</p>\\n<p>\\n  This proof of consent must be submitted to the Finnish Immigration\\n  Service (<a target=\\\"_blank\\\" href=\\\"https://migri.fi/en/home\\\">Migri.fi</a>) when applying\\n  for a residence permit.\\n</p>\"}},{\"id\":\"Nordic-K2-AB\",\"topic\":null,\"heading\":\"More or less than 90 days\",\"content\":{\"html\":\"<p>\\n  Citizens of the Nordic countries (Denmark, Iceland, Norway or Sweden)\\n  have the same right to work, study and start a business in Finland as\\n  Finnish citizens. Therefore, they do not need a residence permit.\\n</p>\\n<p>\\n  You need to submit a <a target=\\\"_blank\\\" href=\\\"https://dvv.fi/en/moving\\\">notification of\\n  move</a> and present a valid passport or photo ID in person at the\\n  population register (<a target=\\\"_blank\\\" href=\\\"https://dvv.fi/en/moving\\\">Dvv.fi</a>)\\n  within a month of moving to Finland.\\n</p>\"}},{\"id\":\"Nordic-K3-A\",\"topic\":null,\"heading\":\"I will work\",\"content\":{\"html\":\"<p>\\n  You will need a tax card from the Tax Administration (<a target=\\\"_blank\\\"\\n  href=\\\"https://www.vero.fi/en/individuals/tax-cards-and-tax-returns/tax_card/\\\">Vero.fi</a>),\\n  if you plan on working.\\n</p>\\n<p>\\n  If you have not received a personal identity code yet, you can apply for\\n  one at the tax office. You will need to present a signed employment\\n  contract and a valid passport or photo ID to receive a code.\\n</p>\"}},{\"id\":\"Nordic-K3-B\",\"topic\":null,\"heading\":\"I will look for work\",\"content\":{\"html\":\"<p>\\n  Citizens of the Nordic countries have the same right to work, study and\\n  start a business in Finland as Finnish citizens. You are nevertheless\\n  responsible for earning your own livelihood.\\n</p>\\n<p>\\n  If you are a jobseeker, you can register at your local employment office\\n  (<a target=\\\"_blank\\\"\\n  href=\\\"http://www.te-palvelut.fi/te/en/index.html\\\">Te-palvelut.fi</a>).\\n</p>\\n<p>\\n  You will need a tax card from the Tax Administration (<a target=\\\"_blank\\\"\\n  href=\\\"https://www.vero.fi/en/individuals/tax-cards-and-tax-returns/tax_card/\\\">Vero.fi</a>),\\n  if you plan on working.\\n</p>\"}},{\"id\":\"Nordic-K3-C\",\"topic\":null,\"heading\":\"I will study\",\"content\":{\"html\":\"<p>\\n  Please note that if your only reason for moving to Finland is to study,\\n  you will likely not be eligible for state-sponsored social benefits, as\\n  you will be considered a temporary resident. See thestate benefit\\n  agencys website <a target=\\\"_blank\\\"\\n  href=\\\"http://www.kela.fi/web/en/financial-aid-for-students-eligibility\\\">Kela.fi</a>\\n  for more information.\\n</p>\"}},{\"id\":\"Nordic-K4-A\",\"topic\":null,\"heading\":\"I'm planning to work while studying\",\"content\":{\"html\":\"<p>\\n  You will need a tax card from the Tax Administration (<a target=\\\"_blank\\\"\\n  href=\\\"https://www.vero.fi/en/individuals/tax-cards-and-tax-returns/tax_card/\\\">Vero.fi</a>),\\n  if you plan on working.\\n</p>\\n<p>\\n  If you have not received a personal identity code yet, you can apply for\\n  one at the tax office. You will need to present a signed employment\\n  contract and a valid passport or photo ID to receive a code.\\n</p>\"}},{\"id\":\"Nordic-K6-A\",\"topic\":null,\"heading\":\"Under 18-years old\",\"content\":{\"html\":\"<p>\\n  If you are under 18 years old, you must have written consent from your\\n  guardian(s) to move to Finland. A notary public or other comparable\\n  authority must confirm this written consent document.\\n</p>\\n<p>\\n  You must submit this proof of consent in person when you submit your\\n  notification of move to the population register (<a target=\\\"_blank\\\"\\n  href=\\\"https://dvv.fi/en/moving\\\">Dvv.fi</a>).\\n</p>\"}},{\"id\":\"GENERAL-1\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Arrange to use an interpreter, if necessary\",\"content\":{\"html\":\"<p>\\n  If you do not speak Finnish or Swedish, you have the right to use an\\n  interpreter when interacting with some public authorities. Interpreter\\n  services must be arranged in advance and often come at no cost. Find\\n  more information at <a target=\\\"_blank\\\"\\n  href=\\\"https://www.infofinland.fi/en/living-in-finland/settling-in-finland/do-you-need-an-interpreter\\\">InfoFinland.fi</a>.\\n</p>\"}},{\"id\":\"GENERAL-2\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Open a bank account\",\"content\":{\"html\":\"<p>\\n  Book an in-person visit at your bank of choice to open an account. Ask\\n  beforehand about the documents you will need to show them. Remember to\\n  request access codes for online banking.\\n</p>\"}},{\"id\":\"GENERAL-3\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Set up a form of strong identification\",\"content\":{\"html\":\"<p>\\n  You will need to acquire a form of strong identification, i.e., online\\n  banking codes, a mobile ID or a police-issued ID card, to use various\\n  e-services in Finland. Learn more at <a target=\\\"_blank\\\"\\n  href=\\\"https://www.suomi.fi/instructions-and-support/information-on-eidentification/identification-using-different-identification-tokens\\\">Suomi.fi</a>.\\n</p>\"}},{\"id\":\"GENERAL-4\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Find a place to live and buy home insurance\",\"content\":{\"html\":\"<p>\\n  Almost all rental agreements will require you to buy home insurance.\\n  Some banks in Finland offer bundled banking and insurance services at a\\n  discount, so ask around for different offers. See the <a target=\\\"_blank\\\"\\n  href=\\\"https://welcome.helsinki/housing-in-housing/\\\">Housing in\\n  Helsinki</a> section of welcome.helsinki for more information.\\n</p>\"}},{\"id\":\"GENERAL-5\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Buy a phone and internet service\",\"content\":{\"html\":\"<p>\\n  You must have a <a target=\\\"_blank\\\"\\n  href=\\\"https://dvv.fi/en/personal-identity-code\\\">personal identity\\n  code</a> and Finnish address to buy a mobile service and/or broadband\\n  subscription. If you do not have a credit history in Finland, you will\\n  be asked to make an advance payment. If you do not yet have an ID code\\n  or address, you can purchase a pre-paid subscription. Check if your\\n  housing agreement includes broadband before you buy a subscription from\\n  an operator. Let your operator know if you want to use a <a target=\\\"_blank\\\"\\n  href=\\\"https://mobiilivarmenne.fi/eng/\\\">mobile ID</a>.\\n</p>\"}},{\"id\":\"GENERAL-6\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Use your Kela card and learn about state benefits\",\"content\":{\"html\":\"<p>\\n  If you are <a target=\\\"_blank\\\"\\n  href=\\\"https://www.kela.fi/web/en/-/eligibility-for-kela-benefits-is-based-on-the-same-criteria-for-everyone#:~:text=10%2F09%2F2015-,Eligibility%20for%20Kela%20benefits%20is%20based%20on%20the%20same%20criteria,reception%20programme%20for%20asylum%20seekers.\\\">eligible\\n  for national health insurance</a> in Finland, you will be issued a Kela\\n  card. You can also apply for it yourself from the state benefits agency\\n  (<a target=\\\"_blank\\\" href=\\\"https://www.kela.fi/web/en/kela-card\\\">Kela.fi</a>). You will\\n  need to show this card to receive state-supported healthcare and\\n  subsidies. Each Kela benefit must be applied for separately, and\\n  decisions are made on a case-by-case basis.\\n</p>\"}},{\"id\":\"GENERAL-7\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Make it a habit to use public transport\",\"content\":{\"html\":\"<p>\\n  Public transport in Helsinki is convenient, reliable and eco-friendly.\\n  The handy <a target=\\\"_blank\\\" href=\\\"https://www.hsl.fi/en/tickets-and-fares/hsl-app\\\">HSL\\n  app</a> allows you to buy tickets and access the <a target=\\\"_blank\\\"\\n  href=\\\"https://www.hsl.fi/en\\\">Journey Planner</a> on your mobile phone.\\n  Check the <a target=\\\"_blank\\\"\\n  href=\\\"https://welcome.helsinki/getting-around-helsinki/\\\">Getting around\\n  the city</a> section of welcome.helsinki for more information.\\n</p>\"}},{\"id\":\"GENERAL-8\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Exchange your driving license\",\"content\":{\"html\":\"<p>\\n  Driving licenses issued in EU/EEA countries are valid in Finland\\n  indefinitely, but it is a good idea to exchange your license for a\\n  Finnish one if you plan to live here permanently. Owners of driving\\n  licenses issued by other countries will need to pass a Finnish driving\\n  exam if they do not exchange their license by the deadline. See more at\\n  <a target=\\\"_blank\\\"\\n  href=\\\"https://ajokortti-info.fi/en/basic-information-about-a-driving-licence/exchanging-a-foreign-driving-licence-for-a-finnish-licence\\\">Ajokortti-info.fi</a>.\\n</p>\"}},{\"id\":\"GENERAL-9\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Sign up for Finnish or Swedish language lessons\",\"content\":{\"html\":\"<p>\\n  While it is true that almost everyone in Helsinki speaks English, we\\n  suggest you start learning one or both of the national languages right\\n  away, as it will bring many advantages. Check <a target=\\\"_blank\\\"\\n  href=\\\"http://www.Finnishcourses.fi\\\">Finnishcourses.fi</a> for suitable\\n  courses near you.\\n</p>\"}},{\"id\":\"GENERAL-10\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Explore your new home\",\"content\":{\"html\":\"<p>\\n  Once you have settled in, remember to take some time to get to know\\n  Helsinkis different neighbourhoods. <a target=\\\"_blank\\\"\\n  href=\\\"https://www.myhelsinki.fi/en\\\">MyHelsinki</a> is great source of\\n  ideas for fun things to see and do!\\n</p>\"}},{\"id\":\"GENERAL-11\",\"always\":true,\"topic\":\"More steps to consider\",\"heading\":\"Enjoy your new life in Helsinki!\",\"content\":{\"html\":\"<p>\\n  Congratulations! You have now finished all the steps and are ready to\\n  start your Helsinki adventure. Remember to visit the <a target=\\\"_blank\\\"\\n  href=\\\"https://welcome.helsinki/\\\">welcome.helsinki</a> website, if you\\n  have any more questions.\\n</p>\"}}]}\n\n//# sourceURL=webpack://WelcomeGuide/./src/assets/configuration.yaml?");

